import React from "react";
import style from "./style.module.css";
import { ICard } from "../../models";

interface CardProps {
  card: ICard;
}

export const Card = ({ card }: CardProps) => {
  const randomDate = (rangeOfDays, startHour, hourRange) => {
    var today = new Date(Date.now());
    return new Date(
      today.getYear() + 1900,
      today.getMonth(),
      today.getDate() + Math.random() * rangeOfDays,
      Math.random() * hourRange + startHour,
      Math.random() * 60
    );
  };

  return (
    <li className={style.card}>
      <img className={style.card__img} src={card.image} alt={card.title} />
      <h3 className={style.card__title}>{card.title}</h3>
      <p className={style.card__text}>{card.description}</p>
      <p className={style.card__date}>{randomDate()}</p>
    </li>
  );
};
